      "<p style=\"text-align: center; \"><img src=\"data:image/png;base64,\" alt=\"\"><br></p><p>My firstborn daughter just had her first period. While it is true, she reached out, first, to her mum, we discussed this milestone moment together as a family the same day. It was neither awkward nor embarrassing. Both I and her mum have discussed puberty and menstruation with her for the last few years.</p><p>Why? Because we want our daughter to know that there is nothing to fear or to be ashamed of. We want her to know that we are here to support her through this change, and give her everything she needs – sanitary pads and tampons, pain relief medication and hot-water bottles, a cuddle if she needs one, or space if she prefers. We want her to feel confident and in control. It is her right.</p><p>And, yet, I’m all too aware that conversations about menstruation are, in too many families around the world, taboo, not least in Afghanistan.</p><ol><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"data:image/png;base64,\" alt=\"\" style=\"font-size: 1rem; text-align: center;\"><br></li></ol><p><br></p><p><b>Ahead of Menstrual Hygiene Day, UNICEF Afghanistan (ACO) conducted a U-Report poll asking girls about their experience of menstruation. Of the more than 180,000 U-Reporters ACO boasts, unusually, we only received 3,000 responses. We received over 100 angry messages criticizing us for asking such shameful questions.</b></p><ul><li>- Around half of the girls told us they started menstruation without knowing what was happening to them or why…</li><li>- 38% of the girls polled said they felt sad when they have their period; 18% felt dirty…</li><li>- 30% told us they have missed school due to menstruation -- between 2 to 5 days at least each month…</li><li><br></li><li>Imagine the toll on these girls’ mental health as they agonize over why they’re bleeding. Or their stress and shame at feeling dirty? Or their frustration at losing 2-5 days of school each month – 24 days a year, 6 months by the end of high school.&nbsp;</li><li><u><br></u></li></ul><p><u>Roughly 800 million girls and women menstruate every day. And still, in 2021, in too many countries and cultures, there’s so much stigma attached to this natural, biological function that girls often dread their period because they are cruelly ostracized.&nbsp;</u></p><p>&nbsp;</p><p>In Nepal, India, Indonesia, and parts of Nigeria, girls are banished to huts while they bleed. In some tribes in Uganda, women are banned from drinking cow’s milk because of the belief that it would contaminate the whole herd. Elsewhere, girls can either be forced to bathe, or forbidden from bathing. Others are not allowed to cook in case they taint the meal.&nbsp;</p><p>COVID-19 has exacerbated these challenges. Countless girls, and their families, have been forced into poverty, and now face difficult choices on what to spend meager resources on – sanitary pads or food and other household necessities. As the pandemic lurches and lingers, this is set to worsen.</p><p>It strikes me that even as the global development community, including UNICEF, campaigns vigorously to enroll more girls in school – and rightly invests heavily in this critical effort --&nbsp; so, too, are we failing to address the root causes of damaging social norms that prevent girls attending school and cause them to drop out.&nbsp;&nbsp;</p><p>So, their learning opportunities are diminished. They are more vulnerable to exploitation and abuse. They are less likely to excel in the workforce and earn good wages. Or have a voice in their communities.&nbsp; And they’re less likely to instill in their own children a love of learning. In short, the cycle of inequality that holds girls and women back is perpetuated.</p><p><br></p><p><b>By failing to tackle this inequality, we are preventing girls and women from reaching their full potential.&nbsp;</b></p><p><b><br></b></p><p>Am I exaggerating if I call this a development emergency?</p><p>While I agree that procuring and distributing hygiene kits is an important part of UNICEF’s programming for MHM, we must also build more menstrual hygiene facilities in schools. And we must invest more, much more, in changing mindsets at every level of society, and in every country.</p><p>That mindset change has to start in UNICEF’s strategic vision for girls’ empowerment. Just as we have mainstreamed gender across programming so, too, I’d suggest that we do the same for menstrual hygiene management (MHM). Let it be a cross-cutting function. Let us mainstream MHM into all our programs so that, once and for all, there is a concerted effort to address this inequity.</p><p>On this global Menstrual Hygiene Day, ahead of a new Strategic Plan, and the new change strategy on gender-transformative programming, let us be bold and commit to a situational analysis of how Country Offices are programming for menstrual hygiene, what results in we have achieved for girls, and how we can practically and sustainably change the reality for the next generation of girls – whoever they are, wherever they live.</p>";
